window.bookSummaryJSON = "<p>Over the years, startling evidence has been unearthed, challenging established notions of the origins of Earth and life on it and suggesting the existence of a superior race of beings who once inhabited our world. </p> <p>The product of 30 years of intensive research, <i>The 12th Planet</i> is the first book in Zecharia Sitchin's prophetic Earth Chronicles series - a revolutionary body of work that offers indisputable documentary proof of humanity's extraterrestrial forefathers. Travelers from the stars, they arrived eons ago, and planted the genetic seed that would ultimately blossom into a remarkable species...called Man. </p> <p><i>The 12th Planet</i> brings to life the Sumerian civilization, presenting millennia-old evidence of the existence of Nibiru, the home planet of the Anunnaki, and of the landings of the Anunnaki on Earth every 3,600 years, and reveals a complete history of the solar system as told by these early visitors from another planet. </p>"; 
